import React from "react";
import ReactDOM from "react-dom";
import "./Square.css";
import "./Board.css";

class Square extends React.Component {
  constructor(props) {
    super(props);
    this.handleClick = this.handleClick.bind(this);
    this.state = { clicked: false, message: "" };
  }
  render() {
    return (
      <div className="square" onClick={this.handleClick}>
        {this.state.message}
      </div>
    );
  }
  handleClick() {
    if (!this.state.clicked) {
      console.log(this.props.squareNum);
      this.setState({ clicked: true, message: "X" });
    }
  }
}
export class Board extends React.Component {
  render() {
    return (
      <div className="bigboard">
        <div className="row">
          <Square squareNum={1} />
          <Square squareNum={2} />
          <Square squareNum={3} />
        </div>
        <div className="row">
          <Square squareNum={4} />
          <Square squareNum={5} />
          <Square squareNum={6} />
        </div>
        <div className="row">
          <Square squareNum={7} />
          <Square squareNum={8} />
          <Square squareNum={9} />
        </div>
      </div>
    );
  }
}
